import React from 'react';
import { Link } from 'react-router-dom';
import { Container, Button } from 'react-bootstrap';

const AdminMainPage = () => {
  return (
    <Container style={containerStyle}>
      <h1 style={headerStyle}>Admin Dashboard</h1>

      {/* Navigation Links */}
      <div style={navigationStyle}>
        <Link to="/admin/users" style={linkStyle}>
          <Button variant="primary">Manage Users</Button>
        </Link>
        <Link to="/admin/banners" style={linkStyle}>
          <Button variant="primary">Manage Banners</Button>
        </Link>
      </div>

      {/* You can include other content or components here */}
    </Container>
  );
};

const containerStyle = {
  backgroundColor: '#f4f4f4',
  padding: '20px',
  margin: '20px',
  border: '1px solid #ccc',
  borderRadius: '8px',
};

const headerStyle = {
  marginBottom: '20px',
};

const navigationStyle = {
  display: 'flex',
  gap: '10px',
};

const linkStyle = {
  textDecoration: 'none',
};

export default AdminMainPage;
